import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { dashboardManager } from '../redux/slices/managerSlices'
import { Table, Row, Col, Tooltip, User, Text ,Button} from "@nextui-org/react";
import { Link, Navigate } from "react-router-dom";
// import { EditIcon } from "./Icon/EditIcon";
// import { DeleteIcon } from "./Icon/DeleteIcon";
const Home = () => {
    const dispatch=useDispatch();
    useEffect(()=>{
        dispatch(dashboardManager());
        },[dispatch]);

const emplyeedata=useSelector((state)=>state?.users?.userAuth);
const {employees}=emplyeedata;
    const columns = [
        { name: "NAME", uid: "name" },
        { name: "ROLE", uid: "role" },
        { name: "STATUS", uid: "status" },
        { name: "ACTIONS", uid: "actions" },
      ];
      const users = employees;
      const renderCell = (user, columnKey) => {
        const cellValue = user[columnKey];
        switch (columnKey) {
          case "name":
            return (
              <User squared src='https://cdn-icons-png.flaticon.com/512/149/149071.png' name={user.firstName +' '+user.lastName} css={{ p: 0 }}>
                {user.email}
              </User>
            );
          case "role":
            return (
              <Col>
                <Row>
                  <Text b size={14} css={{ tt: "capitalize" }}>
                    {cellValue}
                  </Text>
                </Row>
                <Row>
                  <Text b size={13} css={{ tt: "capitalize", color: "$accents7" }}>
                    {user?.createdAt}
                  </Text>
                </Row>
              </Col>
            );
          case "status":
            return <Button >1</Button>;
    
          case "actions":
            return (
              <Row justify="center" align="center">
               
                <Col css={{ d: "flex" }}>
                  <Tooltip content="Edit user">
                  <Button >1</Button>
                  </Tooltip>
                </Col>
                <Col css={{ d: "flex" }}>
                  <Tooltip
                    content="Delete user"
                    color="error"
                    onClick={() => console.log("Delete user",user.empId)}
                  >
                <Button >1</Button>
                  </Tooltip>
                </Col>
              </Row>
            );
          default:
            return cellValue;
        }
      };
  return (
    <div>
         <Table
      aria-label="Example table with custom cells"
      css={{
        height: "auto",
        minWidth: "100%",
      }}
      selectionMode="none"
    >
      <Table.Header columns={columns}>
        {(column) => (
          <Table.Column
            key={column.uid}
            hideHeader={column.uid === "actions"}
            align={column.uid === "actions" ? "center" : "start"}
          >
            {column.name}
          </Table.Column>
        )}
      </Table.Header>
      <Table.Body items={users}>
        {(item) => (
          <Table.Row>
            {(columnKey) => (
              <Table.Cell>{renderCell(item, columnKey)}</Table.Cell>
            )}
          </Table.Row>
        )}
      </Table.Body>
    </Table>
    </div>
  )
}

export default Home
